export default function BoxProject({setDetail, nom, caption, altImg}) {

    return (
        <div className="col-lg-4 mb-4" onClick={()=> setDetail(nom)}>
            <div style={{
                borderRadius: 18,
                border: (!caption ? "1px" : "0px") + " dashed white",
                height: 308,
                overflow: "hidden",
                cursor: "pointer",
                display: "flex",
                alignItems: "center",
                boxShadow: "0 5px 5px black"
            }}>
                <img src={caption} alt={altImg} height="100%" />
            </div>
        </div>
    )
}
